import { BrowserRouter, Routes, Route } from "react-router-dom";
import "./css/App.css";
import Registro from "./routes/unlogin/Registro";
import Home from "./routes/unlogin/Home";
import Login from "./routes/unlogin/Login";
import Nosotros from "./routes/unlogin/Nosotros";
import FAQ from "./routes/unlogin/FAQ";
import Espaniol from "./routes/unlogin/cursos/Espanol";
import Mates from "./routes/unlogin/cursos/Mates";
import Gestionar from "./routes/unlogin/adminView/Gestionar";
import Session from "./session/Session";
import { Navbar, Container, Nav, NavDropdown } from "react-bootstrap";
import { Link } from "react-router-dom";

export default function App() {
    // Con esto se pone el login c:
    Session.setLogin(true);
    Session.setUser("usuario");

    // Con esto se obtiene el login c:
    let login = Session.isLogin();
    let user = Session.getUser();

    /* TODO gestionar alumnos:
        eliminar alumnos
        ver respuestas de alumnos        
    */
    return (
        <BrowserRouter>
            <Navbar bg="light" variant="light">
                <Container>
                    <Navbar.Brand className="">
                        <Link to="/">JADE</Link>
                    </Navbar.Brand>
                    <Nav className="me-auto navegacion-links">
                        <Nav.Link>
                            <Link to="/Nosotros">Nosotros</Link>
                        </Nav.Link>
                        <Nav.Link>
                            <Link to="/FAQ">FAQ</Link>
                        </Nav.Link>
                        {login === true ? (
                            <>
                                {user === "usuario" ? (
                                    <>
                                        <NavDropdown
                                            title="Cursos"
                                            id="collasible-nav-dropdown"
                                        >
                                            <NavDropdown.Item>
                                                <Link to="/Espaniol">
                                                    Español
                                                </Link>
                                            </NavDropdown.Item>
                                            <NavDropdown.Item>
                                                <Link to="/Mates">
                                                    Matemáticas
                                                </Link>
                                            </NavDropdown.Item>
                                        </NavDropdown>
                                    </>
                                ) : (
                                    <>
                                        <Nav.Link>Gestionar alumnos</Nav.Link>
                                    </>
                                )}
                            </>
                        ) : (
                            <>
                                <Nav.Link>
                                    <Link to="/login">Iniciar sesión</Link>
                                </Nav.Link>
                                <Nav.Link>
                                    <Link to="/registrar">Registrarse</Link>
                                </Nav.Link>
                            </>
                        )}
                    </Nav>
                </Container>
            </Navbar>
            <Routes>
                <Route path="/" element={<Home />} />
                <Route path="/Nosotros" element={<Nosotros />} />
                <Route path="/FAQ" element={<FAQ />} />
                {login === true ? (
                    <>
                        {user === "usuario" ? (
                            <>
                                <Route
                                    path="/cursos/Espanol"
                                    element={<Espaniol />}
                                />
                                <Route
                                    path="/cursos/Mates"
                                    element={<Mates />}
                                />
                            </>
                        ) : (
                            <>
                                <Route
                                    path="/adminView/Gestionar"
                                    element={<Gestionar />}
                                />
                            </>
                        )}
                    </>
                ) : (
                    <>
                        <Route path="/login" element={<Login />} />
                        <Route path="/registrar" element={<Registro />} />
                    </>
                )}
            </Routes>
        </BrowserRouter>
    );
}
